import "./conversationScreen.css";
import "./usersList.css";
import {useState} from 'react';
function UsersList(){
      const [clients, setClients] = useState(false);
      const [coachs, setCoachs] = useState(false);
      const [sup, setSup] = useState(false);
      function chooseType(type){
            switch (type) {
                  case "clients":
                        setClients(true);
                        setCoachs(false);
                        setSup(false);
                        break;
                  case "coachs":
                        setClients(false);
                        setCoachs(true);
                        setSup(false);
                        break;
                  case "sup":
                        setClients(false);
                        setCoachs(false);
                        setSup(true);
                        break;
            
                  default:
                        break;
            }
            return "clicked" 
      }
      return <div className="usersListWrapper" >
            <div className="usersType">
                  <div className="type" onClick={chooseType}>
                        Clients
                  </div>
                  <div className="type">
                        Coachs
                  </div>
                  <div className="type" >
                        Superviseurs
                  </div>
            </div>
      </div>
}
export default UsersList ;
